/**
 * The direction options for flipper.
 * @public
 */
export var FlipperDirection;
(function (FlipperDirection) {
    FlipperDirection["next"] = "next";
    FlipperDirection["previous"] = "previous";
})(FlipperDirection || (FlipperDirection = {}));
